import React, { Component } from 'react';
import Flat from './flat';
import './app.css';

class App extends Component {

    constructor(props) {
        super(props);
        this.state = {
            flats: []
        };
    }

    componentDidMount() {
        console.log('1')
    }

    render() {
        console.log('2')
        return (

            <div className="app">
                < div className="main">
                    <div className="search"></div>
                    <div className="flats">
                        {this.state.flats.map((flat, index) => {
                            return <Flat flat={flat} key={index} />
                        })}
                    </div>
                </div>
                <div className="map"></div>
            </div>
        );
    }
}

export default App;
